import { useMemo } from "react";
import "./MainNav.css";

const MainNav = ({ propDisplay, propDisplay1 }) => {
  const hOMEStyle = useMemo(() => {
    return {
      display: propDisplay,
    };
  }, [propDisplay]);

  const aIChatStyle = useMemo(() => {
    return {
      display: propDisplay1,
    };
  }, [propDisplay1]);

  return (
    <div className="main-nav5">
      <div className="navitem22">
        <div className="bitcoin-iconshome-outline5">
          <img
            className="vector-icon56"
            loading="lazy"
            alt=""
            src="/vector.svg"
          />
        </div>
        <div className="home-container">
          <div className="home5" style={hOMEStyle}>
            HOME
          </div>
        </div>
      </div>
      <div className="navitem23">
        <img
          className="vector-icon57"
          loading="lazy"
          alt=""
          src="/vector-1.svg"
        />
        <div className="ai-chat-wrapper1">
          <div className="ai-chat5" style={aIChatStyle}>
            AI Chat
          </div>
        </div>
      </div>
    </div>
  );
};

export default MainNav;
